Are you ready to tackle the CCIE R&amp;S Version 5 written and lab exams? Or are you just interested in really mastering particular routing and switching technologies? Either way, this exciting new CBT Nuggets course is for you! Join Keith Barker and Anthony Sequeira as they guide you through the latest and current R&amp;S technologies. This course is the first of six courses that make up the entire curriculum. These six courses follow the official blueprint perfectly.

Recommended skills:
Although not required, it is recommended that a person preparing for the CCIE in Routing and Switching already have the skills and knowledge addressed in the Cisco CCNA and CCNP for R/S. (Those courses are available in the CBT Nuggets IT library). Knowledge of using GNS3 will be helpful for individuals who plan on creating a virtualized network to practice with. (GNS3 training is also available via CBT Nuggets).


Recommended equipment:
GNS3 or physical routers, and 3 physical switches.


The Cisco Certified Internetwork Expert, or CCIE, is a technical certification offered by Cisco Systems. The CCIE certifies the skills required of network engineers to plan, operate and troubleshoot complex, converged network infrastructures on a wide variety of Cisco equipment.

The CCIE is one of the most prestigious networking certification in the industry.
